import React from 'react';
import ListItem from './ListItem';

const List = ({ articles, isLowData }) => {
  return (
    <div>
      {articles.map((article, index) => (
        <div
          key={index}
          className={`list-item ${isLowData ? 'background-image' : ''}`}
          style={{ backgroundImage: isLowData ? `url(${article.image})` : 'none' }}
        >
          {!isLowData && <img src={article.image} alt={article.title} className="list-item-image" />}
          <p>{article.title}</p>
        </div>
      ))}
    </div>
  );
};

export default List;
